//****************************************** dynamic array ********************************///
typedef struct {
    int *data;
    size_t size;
    size_t capacity;
} DynamicArray;

DynamicArray* createDynamicArray(size_t initialCapacity) {
    DynamicArray *arr = malloc(sizeof(DynamicArray));
    arr->data = malloc(initialCapacity * sizeof(int));
    arr->size = 0;
    arr->capacity = initialCapacity;
    return arr;
}

void append(DynamicArray *arr, int value) {
    if (arr->size == arr->capacity) {
        arr->capacity *= 2;  // Double the capacity
        arr->data = realloc(arr->data, arr->capacity * sizeof(int));
        if (!arr->data) {
            fprintf(stderr, "Failed to allocate memory.\n");
            exit(1);
        }
    }
    arr->data[arr->size++] = value;
}

int pop(DynamicArray *arr) {
    if (arr->size == 0) {
        fprintf(stderr, "Error: Attempt to pop from an empty array.\n");
        exit(1);
    }

    arr->size--;

    // Reduce capacity if size is below 25% of the current capacity
    if (arr->size < arr->capacity / 4) {
        arr->capacity /= 2;  // Halve the capacity
        arr->data = realloc(arr->data, arr->capacity * sizeof(int));
        if (!arr->data) {
            fprintf(stderr, "Failed to allocate memory.\n");
            exit(1);
        }
    }

    return arr->data[arr->size];
}


void freeDynamicArray(DynamicArray *arr) {
    free(arr->data);
    free(arr);
}
