// Function to remove elements from an array
void removeElements(double arr[], int* size, int indices[], int numIndices) {
    int newSize = *size - numIndices;
    for (int i = 0, newIndex = 0, removed = 0; i < *size; i++) {
        if (removed < numIndices && i == indices[removed]) {
            removed++;
            continue;
        }
        arr[newIndex++] = arr[i];
    }
    *size = newSize;
}




static double rt_powd_snf(double base, double exponent) {
    double result;
    if (isnan(base) || isnan(exponent)) {
        result = NAN;
    } else {
        double baseAbs;
        double exponentAbs;
        baseAbs = fabs(base);
        exponentAbs = fabs(exponent);
        if (isinf(exponent)) {
            if (baseAbs == 1.0) {
                result = 1.0;
            } else if (baseAbs > 1.0) {
                if (exponent > 0.0) {
                    result = INFINITY;
                } else {
                    result = 0.0;
                }
            } else if (exponent > 0.0) {
                result = 0.0;
            } else {
                result = INFINITY;
            }
        } else if (exponentAbs == 0.0) {
            result = 1.0;
        } else if (exponentAbs == 1.0) {
            if (exponent > 0.0) {
                result = base;
            } else {
                result = 1.0 / base;
            }
        } else if (exponent == 2.0) {
            result = base * base;
        } else if ((exponent == 0.5) && (base >= 0.0)) {
            result = sqrt(base);
        } else if ((base < 0.0) && (exponent > floor(exponent))) {
            result = NAN;
        } else {
            result = pow(base, exponent);
        }
    }
}


void findTrueIndices(int const inputArray[1050], int foundIndices[], int indicesSize[2])
{
    int indexCount;
    int currentIndex;
    bool exitCondition;
    indexCount = 0;
    indicesSize[0] = 1;
    currentIndex = 0;
    exitCondition = false;
    while ((!exitCondition) && (currentIndex < 1050)) {
        if (inputArray[currentIndex]) {
            indexCount++;
            foundIndices[indexCount - 1] = currentIndex + 1;
            if (indexCount >= 1050) {
                exitCondition = true;
            } else {
                currentIndex++;
            }
        } else {
            currentIndex++;
        }
    }
    if (indexCount < 1) {
        indicesSize[1] = 0;
    } else {
        indicesSize[1] = indexCount;
    }
}


